function eat(food) {
    console("來去吃" + food + "!");
}


function hungryEat(hungry) {
    if (hungry < 3 && hungry >= 0) {
        eat("比薩");
    }
    else if (hungry >= 3 && hungry < 8) {
        eat("生菜沙拉");
    }
    else if (hungry >= 8 && hungry <= 10) {
        console.log("先不吃東西了，很飽了!");
    }
    else {
        console.log("請輸入範圍內數字(0~10)");
    }
}


